import React, { useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ScrollView,
  Modal,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { numbers } from '../data/gujaratiData';

const NumbersScreen = () => {
  const [selectedNumber, setSelectedNumber] = useState(null);
  const [modalVisible, setModalVisible] = useState(false);

  const handleNumberPress = (number) => {
    setSelectedNumber(number);
    setModalVisible(true);
  };

  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>અંક</Text>
        <Text style={styles.englishTitle}>Numbers</Text>
        <Text style={styles.subtitle}>ગુજરાતી અંક શીખો</Text>
        <Text style={styles.englishSubtitle}>Learn Gujarati Numbers</Text>
      </View>

      <View style={styles.content}>
        <View style={styles.infoBox}>
          <Ionicons name="information-circle" size={24} color="#4ECDC4" />
          <Text style={styles.infoText}>
            ગુજરાતી અંકો ૦ થી ૧૦ સુધી. તમે તેમને ટચ કરીને સાંભળી શકો છો.
          </Text>
        </View>

        <View style={styles.numbersGrid}>
          {numbers.map((number, index) => (
            <TouchableOpacity
              key={index}
              style={styles.numberCard}
              onPress={() => handleNumberPress(number)}
              activeOpacity={0.7}
            >
              <Text style={styles.numberSymbol}>{number.number}</Text>
              <Text style={styles.numberPronunciation}>{number.pronunciation}</Text>
              <Text style={styles.numberEnglish}>{number.english}</Text>
            </TouchableOpacity>
          ))}
        </View>

        <View style={styles.practiceSection}>
          <Text style={styles.practiceTitle}>Practice Counting</Text>
          <Text style={styles.practiceText}>
            Try counting from ૦ to ૧૦ in Gujarati!
          </Text>
          <TouchableOpacity style={styles.practiceButton}>
            <Ionicons name="play" size={20} color="white" />
            <Text style={styles.practiceButtonText}>Start Practice</Text>
          </TouchableOpacity>
        </View>
      </View>

      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => setModalVisible(false)}
      >
        <View style={styles.modalOverlay}>
          <View style={styles.modalContent}>
            {selectedNumber && (
              <>
                <View style={styles.modalHeader}>
                  <Text style={styles.modalTitle}>{selectedNumber.number}</Text>
                  <TouchableOpacity
                    onPress={() => setModalVisible(false)}
                    style={styles.closeButton}
                  >
                    <Ionicons name="close" size={24} color="#666" />
                  </TouchableOpacity>
                </View>

                <View style={styles.modalBody}>
                  <View style={styles.pronunciationSection}>
                    <Text style={styles.sectionTitle}>Pronunciation</Text>
                    <Text style={styles.pronunciationText}>{selectedNumber.pronunciation}</Text>
                  </View>

                  <View style={styles.englishSection}>
                    <Text style={styles.sectionTitle}>English</Text>
                    <Text style={styles.englishText}>{selectedNumber.english}</Text>
                  </View>

                  <TouchableOpacity style={styles.listenButton}>
                    <Ionicons name="volume-high" size={24} color="white" />
                    <Text style={styles.listenText}>Listen</Text>
                  </TouchableOpacity>
                </View>
              </>
            )}
          </View>
        </View>
      </Modal>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    backgroundColor: '#4ECDC4',
    padding: 30,
    alignItems: 'center',
    borderBottomLeftRadius: 30,
    borderBottomRightRadius: 30,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 5,
  },
  englishTitle: {
    fontSize: 16,
    color: 'white',
    marginBottom: 15,
  },
  subtitle: {
    fontSize: 14,
    color: 'white',
    textAlign: 'center',
    marginBottom: 5,
  },
  englishSubtitle: {
    fontSize: 12,
    color: 'white',
    textAlign: 'center',
    opacity: 0.9,
  },
  content: {
    padding: 20,
  },
  infoBox: {
    backgroundColor: '#E0F2F1',
    borderRadius: 10,
    padding: 15,
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 20,
  },
  infoText: {
    fontSize: 14,
    color: '#00695C',
    marginLeft: 10,
    flex: 1,
  },
  numbersGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
    marginBottom: 30,
  },
  numberCard: {
    backgroundColor: 'white',
    borderRadius: 15,
    padding: 20,
    marginBottom: 15,
    width: '48%',
    alignItems: 'center',
    elevation: 2,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 1,
    },
    shadowOpacity: 0.22,
    shadowRadius: 2.22,
  },
  numberSymbol: {
    fontSize: 36,
    fontWeight: 'bold',
    color: '#4ECDC4',
    marginBottom: 8,
  },
  numberPronunciation: {
    fontSize: 16,
    color: '#333',
    fontWeight: '500',
    marginBottom: 4,
  },
  numberEnglish: {
    fontSize: 14,
    color: '#666',
  },
  practiceSection: {
    backgroundColor: '#FFF3E0',
    borderRadius: 15,
    padding: 20,
    alignItems: 'center',
  },
  practiceTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#E65100',
    marginBottom: 8,
  },
  practiceText: {
    fontSize: 14,
    color: '#E65100',
    textAlign: 'center',
    marginBottom: 15,
  },
  practiceButton: {
    backgroundColor: '#FF9800',
    borderRadius: 25,
    paddingHorizontal: 20,
    paddingVertical: 10,
    flexDirection: 'row',
    alignItems: 'center',
  },
  practiceButtonText: {
    color: 'white',
    fontSize: 16,
    fontWeight: 'bold',
    marginLeft: 8,
  },
  modalOverlay: {
    flex: 1,
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    justifyContent: 'center',
    alignItems: 'center',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 20,
    padding: 0,
    width: '85%',
    maxHeight: '70%',
  },
  modalHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 20,
    borderBottomWidth: 1,
    borderBottomColor: '#eee',
  },
  modalTitle: {
    fontSize: 48,
    fontWeight: 'bold',
    color: '#4ECDC4',
  },
  closeButton: {
    padding: 5,
  },
  modalBody: {
    padding: 20,
  },
  pronunciationSection: {
    marginBottom: 20,
  },
  englishSection: {
    marginBottom: 30,
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 8,
  },
  pronunciationText: {
    fontSize: 18,
    color: '#666',
  },
  englishText: {
    fontSize: 16,
    color: '#666',
    fontStyle: 'italic',
  },
  listenButton: {
    backgroundColor: '#4ECDC4',
    borderRadius: 25,
    padding: 15,
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  listenText: {
    color: 'white',
    fontSize: 16,
    fontWeight: 'bold',
    marginLeft: 8,
  },
});

export default NumbersScreen;
